import React, { useEffect } from "react";
import "./App.css";

function App() {
  const [data, setData] = React.useState([]);

  useEffect(() => {
    const tempDataHolder = [];
    fetch("https://api.jikan.moe/v4/anime/38000/characters")
      .then((response) => response.json())
      .then((data) => tempDataHolder.push(data.data))
      .then(console.log(tempDataHolder))
      .catch((err) => console.error(err));
  }, []);

  return <div>{console.log(data)}</div>;
}

export default App;

